import React from "react";

function MainContent() {
  return (
    <>
      <div className=" mb-10 flex min-h-[800px] justify-center mt-2  h-16 bg-gray-100">
        <div className="grid grid-cols-2	 rounded  w-5/6 h-full bg-blue-200">
          <div className="justify-center flex flex-col ">
            
            <h1>Best pc ever</h1>
            <button
              type="button"
              className="self-center w-72 h-16 text-white bg-blue-700 hover:bg-blue-800 focus:outline-none focus:ring-4 focus:ring-blue-300 font-medium rounded-full text-md px-5 py-2.5 text-center mr-2 mb-2 dark:bg-blue-600 dark:hover:bg-blue-700 dark:focus:ring-blue-800">
                  Contactanos
            </button>
          </div>

          <p>img</p>

        </div>
        
      </div>
    
    </>
    
  );
}

export { MainContent };
